function changeMediaMode( newMode) {

  if( mediaJustCaptured())
    return;

  $('.js--modeSelector')
    .removeClass('is--active')
    .filter(function(){
      return $(this).attr('data-mediatype') == newMode;
    })
      .addClass('is--active')
    .end()
  ;

  backAnimation();

  console.log('A new mode has been selected : ' + newMode);
  store.set('lastMode', newMode);

  switch( newMode){
    case 'photo':
      photoDisplay();
      break;
    case 'video':
      videoDisplay();
      break;
    case 'stopmotion':
      stopMotionDisplay();
      break;
    case 'audio':
      audioDisplay();
      break;
  }

}



